import React, {useState} from 'react'
import './NavBar.css'; 

import logo from '../Assets/logo.png'; 
import cart_icon from '../Assets/cart_icon.png'; 

const NavBar = () => {

        const[menu, setMenu] = useState("shop")

    return (
        <div className='navbar'>
            <div className='nav_logo'>
                <img src={logo} alt="Shop logo"/>
                <p>WhiskyWink</p>
            </div>
            <ul className="nav-menu">
                <li onClick={()=>{setMenu("shop")}}>Shop{menu==="shop"?<hr/>:<></>}</li>
                <li onClick={()=>{setMenu("Bourbon")}}>bourbon{menu==="bourbon"?<hr/>:<></>}</li>
                <li onClick={()=>{setMenu("Scotch Whisky")}}>Scotch{menu==="Scotch Whisky"?<hr/>:<></>}</li>
                <li onClick={()=>{setMenu("Japanese Whisky")}}>Japanese{menu==="Japanese"?<hr/>:<></>}</li>
                <li onClick={()=>{setMenu("Irish Whisky")}}>Irish{menu==="Irish"?<hr/>:<></>}</li>
            </ul>
            <div className="nav-login-cart">
                <button>Login</button>
                <img src={cart_icon} alt="" />
                <div className= "nav-cart-count">0</div>
            </div>
        </div>
    );
}

export default NavBar;
